"""
Given a string S and a string T, find the minimum window in S which 
will contain all the characters in T in complexity O(n).

For example,
S = "ADOBECODEBANC"
T = "ABC"
Minimum window is "BANC".

Note:
If there is no such window in S that covers all characters in T, 
return the emtpy string "".

If there are multiple such windows, you are guaranteed that there 
will always be only one unique minimum window in S.
"""

class Solution:
    # @return a string
    def minWindow(self, S, T):
    	def notFinished(dic,target):
    		for char in T:
    			if dic[char] < target[char]:
    				return True
    		return False

    	targerCount = {}
    	for char in T:
    		targerCount[char] = targerCount.get(char, 0) + 1
    	targetCountCopy = targerCount.copy()

    	i = 0
    	start = None

    	currentCount = {}
    	for char in T:
    		currentCount[char] = 0
    	while i < len(S) and notFinished(currentCount, targerCount):
    		char = S[i]
    		if char in currentCount:
    			if start is None:
    				start = i
    			currentCount[char] += 1
    		i += 1
    	if start == None or notFinished(currentCount, targerCount):
    		return ""

    	while S[start] not in currentCount or currentCount[S[start]] > targerCount[S[start]]:
    		#do not compare the whole dic
    		#print '!', not notFinished(currentCount, targerCount)
    		if S[start] in currentCount:
    			currentCount[S[start]] -= 1
    		start += 1
    		
    	bestStart = start
    	end = i
    	#print end, start, S[start]
    	mini = end - start - 1
    	#print mini, 'L'
    	while end < len(S):
    		char = S[end]
    		#print '#', char
    		if char in currentCount:
    			currentCount[S[end]] += 1
    		if char == S[start]:
    			#print '@', end
    			while S[start] not in currentCount or currentCount[S[start]] > targerCount[S[start]]:
    				#do not compare the whole dic
    				#print '!', not notFinished(currentCount, targerCount)
    				if S[start] in currentCount:
    					currentCount[S[start]] -= 1
    				start += 1
    			#currentCount[S[start-1]] += 1
    			#start -= 1
    			#print '#@', start, S[start]
    			if mini > end - start:
    				bestStart = start
    				mini = end - start
    		end += 1
    	#print bestStart, mini
    	return S[bestStart: bestStart + mini + 1]


